import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

//component: html을 Js에서 쓸 때 쓰는 것<APP />이 형태
//하나의 component만 불러올 수 있으므로 어플리케이션 안에 넣어야 함
ReactDOM.render(<App />,document.getElementById('root'));
